css:
@-moz-document domain("swefilm.tv") {
#takeover{
    display:none
                                    
}
.top-banner{
    display:none
}
.ads_mainmid {
    display:none
}
.p+ a img{
    display:none
}
#header li.menu a.active {
    background: #333;
}
a{
	text-decoration: none;color: #ffffff
}
#main .tab .title ul li a.active {
    background-color: #444;
}

#header li.menu ul li a {
    color: #ffffff;
}
#header li.menu ul {
    display: none;
    position: absolute;
    margin-left: -2px;
    z-index: 9;
    border-top: 5px solid #333;
    background: #333;
    width: 360px;
    padding: 10px;
}
body {
    background: #000 no-repeat top center;
}
#header {
    background-color: #222;
    height: 50px;
    border-top: 1px solid #222;
    border-bottom: 1px solid #222;
    box-shadow: 0 0 10px #222;
}
#main .box {
    background-color: #222;
    margin-bottom: 10px;
}
#header li.search input[type="text"] {
    background: #333;
}
#header li.search input[type="submit"] {
    background-color: #333;
}
search-autocomplete {  
    background-color: #444 !important;
}
.zme-autocomplete-activeItem {
    background-color: #111;
}
.search-item a {   
    color: #ccc;
}
.search-item a:hover {
    background-color: #000;
    border-bottom: 1px solid #111;
}
.search-autocomplete {
    background-color: #333;

}
.tgt-autocomplete-activeItem {
    background-color: #1c1c1c;
}
.icons {
    background-image: url(data:image/png;base64,) !important;
}
.minfo .moviez {
    display: none;
}
.minfo .txt .name h2 {
    color: rgb(192,192,192);
}
.blue-btn, .cc-btn, .fb-btn {
    background-color: #444;
}
#slider li .status span.y, div.m_list li .status span.y, div.tip_img div.load .status span.y, #slider_relate li .status span.y {
    background-color: #444;
}
#slider .carousel-control, #slider_relate .carousel-control {
    background: url("data:image/png;base64,") no-repeat 0 0 !important;
}
#main .home .l1 ul.list li:nth-child(1) span.num, ul.list-play li:nth-child(1) span.num {
    background-color: #111;
}
#main .tab .read {
    background-color: #555;
}
element.style {
    color: #ccc !important;
    margin-left: 40%;
}
}
